description:
This is a rare, out of print book about the Mayan people and their Sacred Calendar. Jaguar Wisdom presents an accessible introduction to the spiritual teachings and practices of the ancient and contemporary Mayan people. Since the Sacred Calendar remains the foundation of the Mayan spiritual tradition, Jaguar Wisdom introduces its complete magical system including correspondences, ritual astrology, and divination. Illustrations, glossary, bibliography, &amp; index.

